import React from "react";
import './UserUI.css'
import { useState } from "react";

const UserUI=()=>{
    const [data,setdata]=useState({
        ProductId:'',
        ProductName:'',
        Productprice:'',

    })

    const [files, setFiles] = useState([])  
const filesHandler = (e) => {
     e.preventDefault()
     setFiles(e.target.files)
}
    return(
        <>
        <form className="form">
            <div className="form-group">
            <label for="id"><h4>Enter Product Id</h4></label>
    <input type="text" className="form-control" id="id" placeholder="ex-123 or abc123" />
    <label for="ProductName"><h4>Enter Product Name</h4></label>
    <input type="text" className="form-control" id="ProductName" placeholder="ex-macbook Air" />
    <label for="Price"><h4>Enter Product Price</h4></label>
    <input type="text" className="form-control" id="Price" placeholder="ex-Rs 12000" />
    <label for="image"><h4>Select Product photo</h4></label>
    <input type="file" class="form-control-file" id="image" onChange={e => filesHandler(e)}></input>
    <button type="button" class="btn btn-primary">Primary</button>
  </div>

        </form>
        </>
    )
}
export default UserUI
